import Home from "./components/Home";
import About_Us from "./components/About_Us";
import { Route, Switch, Redirect } from "react-router-dom";

function App() {
    return (
        <>
            <Router>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route path="About_Us" component={About_Us} />
                    <Redirect to="/" />
                </Switch>
            </Router>
        </>
    );
}

export default App;
